  `sflow_type` varchar(2) DEFAULT '11' COMMENT '单据类型（11入库 12出库 13盘点 14报损）',
  `store_no` varchar(20) DEFAULT NULL COMMENT '库房id',
  `suppe_no` varchar(20) DEFAULT NULL COMMENT '供应商id',
  `default_number` varchar(50) DEFAULT NULL COMMENT '初始票据号',
  `sflow_number` varchar(50) DEFAULT NULL COMMENT '票据号',
  `opert_time` datetime DEFAULT NULL COMMENT '出入库时间',
  `opert_user` bigint DEFAULT NULL COMMENT '采购/领料-经手人id',
  `change_amount` decimal(24,6) DEFAULT NULL COMMENT '变动金额(收款/付款)',
  `total_price` decimal(24,6) DEFAULT NULL COMMENT '合计金额',
  `pay_type` varchar(50) DEFAULT NULL COMMENT '付款类型(现金、记账等)',
  `bill_type` varchar(50) DEFAULT NULL COMMENT '单据类型',
  `sales_user` varchar(50) DEFAULT NULL COMMENT '业务员（可以多个）',
  `discount` decimal(24,6) DEFAULT NULL COMMENT '优惠率',
  `discount_money` decimal(24,6) DEFAULT NULL COMMENT '优惠金额',
  `discount_last_money` decimal(24,6) DEFAULT NULL COMMENT '优惠后金额',
  `account_day` int DEFAULT NULL COMMENT '结算天数',
  `link_number` varchar(50) DEFAULT NULL COMMENT '关联订单号',
  `branch_no` varchar(20) DEFAULT '' COMMENT '科室编号',
  `check_state` varchar(1) DEFAULT '1' COMMENT '状态，1未审核、2已审核、3已转采购|销售',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `delete_flag` char(1) DEFAULT '1' COMMENT '删除标志（1代表存在 0代表删除）',
  `comments` varchar(256) DEFAULT '' COMMENT '更新者',
  `app_code` varchar(256) DEFAULT '' COMMENT '应用编码',
  `version` bigint DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_sflowno` (`sflow_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='出入库单据主表';

