-- ----------------------------
-- Table structure for sys_conteeclass
-- ----------------------------
DROP TABLE IF EXISTS `sys_conteeclass`;
CREATE TABLE `sys_conteeclass` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `class_no` varchar(20) NOT NULL COMMENT '类型ID',
  `class_name` varchar(200) DEFAULT '' COMMENT '类型名称',
  `parent_no` varchar(20) DEFAULT '0' COMMENT '上级类型',
  `order_no` int DEFAULT '1' COMMENT '排序',
  `branch_no` varchar(20) DEFAULT '' COMMENT '分支编号',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `delete_flag` char(1) DEFAULT '1' COMMENT '删除标志（1代表存在 0代表删除）',
  `comments` varchar(256) DEFAULT '' COMMENT '更新者',
  `app_code` varchar(256) DEFAULT '' COMMENT '应用编码',
  `version` bigint DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_classno` (`class_no`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='内容类型表';

