  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `contz_no` varchar(20) NOT NULL COMMENT '内容ID',
  `class_no` varchar(20) DEFAULT '' COMMENT '类型ID',
  `title` varchar(500) DEFAULT '' COMMENT '标题',
