  `comments` varchar(256) DEFAULT '' COMMENT '更新者',
  `app_code` varchar(256) DEFAULT '' COMMENT '应用编码',
  `version` bigint DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_contzno` (`contz_no`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='内容信息表';

