-- ----------------------------
-- Table structure for sys_menusinfo
-- ----------------------------
DROP TABLE IF EXISTS `sys_menusinfo`;
CREATE TABLE `sys_menusinfo` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `menu_no` varchar(20) NOT NULL COMMENT '菜单编号',
  `menu_name` varchar(100) DEFAULT '' COMMENT '菜单名称',
  `menu_code` varchar(200) NOT NULL COMMENT '菜单编码',
  `menu_type` char(2) DEFAULT '01' COMMENT '菜单类型',
  `menu_icon` varchar(100) DEFAULT '' COMMENT '菜单图标',
  `menu_image` varchar(200) DEFAULT '' COMMENT '菜单图片',
  `parent_no` varchar(20) DEFAULT '' COMMENT '父菜单ID',
  `order_no` int DEFAULT '0' COMMENT '显示顺序',
  `path_url` varchar(500) DEFAULT '' COMMENT '路径地址',
  `component` varchar(500) DEFAULT '' COMMENT '页面组件',
  `role_type` varchar(50) DEFAULT '01' COMMENT '角色类型',
  `user_type` varchar(50) DEFAULT '01' COMMENT '用户类型(01咨询师02用户)',
  `pmts_data` varchar(500) DEFAULT NULL COMMENT '权限标识',
  `target` varchar(10) DEFAULT 'self' COMMENT '打开目标',
  `visible` char(1) DEFAULT '1' COMMENT '显示状态（0显示 1隐藏）',
  `quick_flag` char(1) DEFAULT '0' COMMENT '快速连接（0否 1是）',
  `check_state` char(1) DEFAULT '1' COMMENT '状态（1正常 0停用）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
