  `permit_no` varchar(20) NOT NULL COMMENT '菜单ID',
  `permit_name` varchar(50) DEFAULT '' COMMENT '菜单名称',
  `permit_code` varchar(200) DEFAULT '' COMMENT '权限标识',
  `permit_type` char(1) DEFAULT '' COMMENT '菜单类型（M目录 C菜单 F按钮）',
  `parent_no` varchar(20) DEFAULT '0' COMMENT '父菜单ID',
  `order_no` int DEFAULT '0' COMMENT '显示顺序',
  `link_type` char(1) DEFAULT '0' COMMENT '链接类型（0内部链接 1外部链接）',
  `menu_icon` varchar(200) DEFAULT '#' COMMENT '菜单图标',
  `path_url` varchar(500) DEFAULT '#' COMMENT '请求地址',
  `component` varchar(200) DEFAULT '' COMMENT '组件路径',
  `redirect` varchar(200) DEFAULT '' COMMENT '重定向地址',
  `target` varchar(20) DEFAULT '' COMMENT '打开方式（menuItem页签 menuBlank新窗口）',
  `visible` char(1) DEFAULT '0' COMMENT '显示状态（0显示 1隐藏）',
  `check_state` char(1) DEFAULT '0' COMMENT '状态（1正常 0停用）',
  `branch_no` varchar(20) DEFAULT '' COMMENT '分支编号',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `delete_flag` char(1) DEFAULT '1' COMMENT '删除标志（1代表存在 0代表删除）',
  `comments` varchar(256) DEFAULT '' COMMENT '更新者',
  `app_code` varchar(256) DEFAULT '' COMMENT '应用编码',
  `version` bigint DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_permitno` (`permit_no`)
) ENGINE=InnoDB AUTO_INCREMENT=2110 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='菜单权限表';

